import React, { Component } from 'react';

class MainView extends Component {
    render() {
        return (
            <div className="main-item">
                <ul>
                    <li><a href="">Main</a></li>
                    <li><a href="">ssds</a></li>
                    <li><a href="">ffff</a></li>
                </ul>
            </div>
        );
    }
}

export default MainView;
